    "introduce": "O dia 22 de abril de 1500 marcou oficialmente a chegada dos portugueses ao território brasileiro, e esse evento é muito conhecido como “descobrimento do Brasil”. A chegada dos portugueses aqui foi um dos momentos mais marcantes das grandes navegações, realizadas por eles durante todo o século XV. A partir desse acontecimento, a presença portuguesa no território foi constante, embora diminuta no início. A partir da década de 1530, medidas colonizatórias foram implantadas aqui.",
