    "links": [{"i":0,"j":1,"removed":false},{"i":1,"j":2,"removed":false}],
    "scenes": [{"id":1,"content":"<h1>Contexto</h1><p>A chegada dos portugueses ao Brasil foi um dos maiores momentos das <a href=\"https://brasilescola.uol.com.br/historiab/grandes-navegacoes.htm\" rel=\"noopener noreferrer\" target=\"_blank\"><strong>grandes navegações</strong></a>, processo iniciado pelos portugueses no século XV. As grandes navegações são como conhecemos as expedições exploratórias, organizadas pelos portugueses, no Oceano Atlântico ao longo desse século.</p><p><img src=\"data:image/jpeg;base64,\" style=\"display: block; margin: auto; cursor: nwse-resize;\" width=\"340\"></p><p>Isso só foi possível graças a uma série de fatores:</p><ul><li>Unificação territorial</li><li>Estabilidade política</li><li>Revolução de Avis</li><li>Desenvolvimento náutico</li><li>Localização geográfica de Portugal</li></ul><p><br></p><p>A expedição de Pedro Álvares Cabral contava com 13 embarcações, sendo <strong>nove naus, três caravelas e uma naveta de mantimentos</strong>. Os líderes de cada uma das embarcações eram: Pedro Álvares Cabral, Sancho Tovar, Simão de Miranda de Azevedo, Aires Gomes da Silva, Nicolau Coelho, Nuno Leitão da Cunha, Vasco de Ataíde, Bartolomeu Dias, Diogo Dias, Gaspar de Lemos, Luís Pires, Simão de Pina e Pero de Ataíde</p>"},{"id":2,"content":"<h1 class=\"ql-align-justify\">A expedição</h1><p class=\"ql-align-justify\">A expedição de Cabral também contava com 1200 a 1500 homens, que zarparam de Lisboa no dia 9 de março de 1500. Após zarpar, a expedição navegou diretamente para o arquipélago de Cabo Verde, portanto, tomou uma rota distante da costa africana. A rota usual dos portugueses no rumo da Índia era mais próxima da costa, mas o<strong> caminho distinto</strong> sugere que eles tinham um roteiro diferente das demais expedições.</p><p class=\"ql-align-justify\">A rota da expedição de Cabral foi a seguinte<strong>|2|</strong> <strong>|3|</strong>:</p><ul><li class=\"ql-align-justify\"><strong>9 de março</strong>: zarparam de Lisboa.</li><li class=\"ql-align-justify\"><strong>14 de março</strong>: passaram pelas Ilhas Canárias.</li><li class=\"ql-align-justify\"><strong>22 de março</strong>: passaram por Cabo Verde.</li><li class=\"ql-align-justify\"><strong>23 de março</strong>: desaparecimento da nau de Vasco Ataíde.</li><li class=\"ql-align-justify\"><strong>29 e 30 de março</strong>: adentraram a região de calmaria na zona equatorial.</li><li class=\"ql-align-justify\"><strong>10 de abril</strong>: passaram a 210 milhas de Fernando de Noronha.</li><li class=\"ql-align-justify\"><strong>18 de abril</strong>: estavam próximos da Baía de Todos os Santos.</li><li class=\"ql-align-justify\"><strong>21 de abril</strong>: avistaram sinais de aproximação de terra.</li><li class=\"ql-align-justify\"><strong>22 de abril</strong>: avistaram o Monte Pascoal.</li></ul>"},{"id":3,"content":"<h1>A chegada</h1><p class=\"ql-align-justify\">O avistamento de terras, que aconteceu no dia 22 de abril de 1500, foi relatado por Pero Vaz de Caminha, escrivão da expedição, da seguinte maneira:</p><blockquote class=\"ql-align-justify\">No dia seguinte [22 de abril] — quarta-feira pela manhã — topamos aves a que os mesmos chamam de fura-buchos. Neste mesmo dia, à hora de vésperas [entre 15h e 18h], avistamos terra! Primeiramente um grande monte, muito alto e redondo; depois outras serras mais baixas, da parte sul em relação ao monte e, mais, terra chã. Com grandes arvoredos. Ao monte alto o Capitão deu o nome de Monte Pascoal; e à terra, Terra de Vera Cruz.</blockquote><p class=\"ql-align-justify\"><br></p><p class=\"ql-align-justify\"><img src=\"data:image/jpeg;base64,\" style=\"display: block; margin: auto;\" width=\"354\"></p><p class=\"ql-align-justify\"><br></p><p>Apesar de terem avistado terra no dia 22 de abril, foi só no dia seguinte que Cabral decidiu enviar homens para ela, e foi aí que os <strong>primeiros contatos entre portugueses e nativos </strong>aconteceram. O relato de Pero Vaz de Caminha sobre eles afirmou que “eram pardos, todos nus, sem coisa alguma que lhes cobrisse as suas vergonhas. Traziam nas mãos arcos e flechas”</p>"}],
